import React from 'react';

class Card extends React.Component {

    render () {
        this.props.CharacterData.map (char => {
            console.log(char)
        })
        return (
            <div>
                {Object.keys(this.props.CharacterData).map(char => (
                <h2>
                    {this.props.deleteFish}
                </h2>
                ))}
            </div>
        )

    }
}

export default Card;
